	public static void main (String [] args) {
		Resultados2016 res = new Resultados2016();
		for(int i = 0; i < res.datosCircunscripcion.length; i++) {
			Circunscripcion circ = new Circunscripcion();
			circ.setCCAA(res.datosCircunscripcion[i][0]);
			circ.setNombre(res.datosCircunscripcion[i][2]);
			circ.setPoblacion(Integer.parseInt(res.datosCircunscripcion[i][3]));
			circ.setPoblacionVotante(Integer.parseInt(res.datosCircunscripcion[i][4]));
			CircunscripcionDAOImplementation.getInstance().createCircunscripcion(circ);
			Asignacion asig = new Asignacion();
			asig.setId(res.anno*1000+i);
			asig.setAnno(res.anno);
			asig.setCircunscripcion(circ);
			asig.setEscannos(res.escannos[i]);
			AsignacionDAOImplementation.getInstance().createAsignacion(asig);
			for(int j = 0; j < res.partidos.length; j++) {
				if(j != 1) {
					ResultadosVotos resultado = new ResultadosVotos();
					resultado.setId(res.partidos[j] + res.anno + circ.getNombre());
					resultado.setAnno(res.anno);
					resultado.setCircunscripcion(circ);
					resultado.setPartido(res.partidos[j]);
					resultado.setVotosObtenidos(res.datosVotosObtenidos[i][j]);
					if(resultado.getVotosObtenidos() > 0) {
						ResultadosVotosDAOImplementation.getInstance().createResultado(resultado);
					}
				}
			}
		}
		
	}
